import React from "react";
import "./MoveItems.css";

function MoveItems() {
  return (
    <div>
      <ul move-items-container>
        <li className="move-items-button-container">
          <button className="left-arrow move-button"></button>
          <p className="move-shape-b">Move shape</p>
        </li>
        <li className="move-items-button-container">
          <button className="up-arrow move-button"></button>
          <p className="move-position-b">Move position</p>
          <button className="down-arrow move-button"></button>
        </li>
        <li className="move-items-button-container">
          <button className="right-arrow move-button"></button>
          <p className="move-shape-b">Move shape</p>
        </li>
      </ul>
    </div>
  );
}

export default MoveItems;
